import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Keyboard } from "swiper";

import "swiper/css";
import "swiper/css/navigation";

export default function GameList() {
  return (
    <div className="game-list">
      <Swiper
        spaceBetween={20}
        slidesPerView={3}
        modules={[Navigation, Keyboard, Autoplay]}
        navigation
        loop
        keyboard={{
          enabled: true,
        }}
        autoplay={{
          delay: 2500,
          disableOnInteraction: false,
        }}
      >
        <SwiperSlide>
          <img src="https://img.g2a.com/323x433/1x1x0/disneys-hercules-pc-steam-key-europe/5f5b35d27e696c63c667cf32" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://m.media-amazon.com/images/I/511V6QBV6PL._AC_.jpg" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://m.media-amazon.com/images/I/51ahVi99AML._SY445_.jpg" />
        </SwiperSlide>
        <SwiperSlide>
          <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRRYe2tweVMERMrnPEJsOR-E8rfMh4BPrmhHw&usqp=CAU" />
        </SwiperSlide>
      </Swiper>
    </div>
  );
}
